DROP TABLE IF EXISTS produit;
CREATE TABLE produit (cle_produit INT PRIMARY KEY, typologie_produit CHAR (50), titre_produit CHAR (50));

-- Table: retour_client
DROP TABLE IF EXISTS retour_client;
CREATE TABLE retour_client (cle_retour_client INT PRIMARY KEY, note INT, cle_produit INT, ref_magasin INT, date_achat DATE, libelle_source CHAR (50), libelle_categorie CHAR (50), recommandation CHAR);
